INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 1, 'O Pequeno Príncipe', 'Le Petit Prince é uma novela do escritor, aviador aristocrata francês Antoine de Saint-Exupéry, originalmente publicada em inglês e francês em abril de 1943 nos Estados Unidos. Durante a Segunda Guerra Mundial, Saint-Exupéry foi exilado para a América do Norte.', 15.00, 'Antoine de Saint-Exupéry', 'Infantil', 5);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 2, 'Romeu e Julieta', 'Romeu e Julieta\" é talvez, a par de Hamlet, a peça mais conhecida e popular da dramaturgia shakespeariana, porventura, uma das obras mais emblemáticas da literatura mundial, pela dimensão universal que a história trágica de amores contrariados alcançou ao longo dos tempos. Não é uma história original, nos seus contornos temáticos, no recorte das personagens principais, no travejamento das suas linhas de acção, no desfecho fatal que um destino cego impõe a quem se enreda nas suas malhas. Tem origem na densa simplicidade... ', 17.89, 'William Shakespeare', 'Romance', 22);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 3, 'Os Miseráveis', 'Publicado em 1862, \"Os Miseráveis\" permanece, ao longo de mais de um século e meio, um dos romances mais importantes e populares de toda a literatura. Victor Hugo terminou de escrever \"Os Miseráveis\" quando contava sessenta anos. Através da personagem de Jean Valjean, o autor empreendeu uma vasta acusação sobre as desigualdades sociais da sua época.', 21.50, 'Victor Hugo', 'Romance', 15);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 4, 'Admirável Mundo Novo', '\r\n\r\nEdição especial da famosa distopia de Aldous Huxley sobre uma sociedade totalitária do futuro, regida pela tecnologia e pelo materialismo e sob a máscara da democracia e da felicidade.\r\n\r\n\"Admirável Mundo Novo\" é uma parábola fantástica sobre a desumanização dos seres humanos. Na utopia negativa descrita no livro, o Homem foi subjugado pelas suas invenções. A ciência, a tecnologia e a organização social deixaram de estar ao serviço do Homem; tornaram-se os seus amos. Desde a publicação deste livro, o mundo rumou a passos tão largos na direcção errada que, se eu escrevesse hoje a mesma obra, a acção não distaria seiscentos anos do presente, mas somente duzentos. O preço da liberdade, e até da simples humanidade, é a vigilância eterna.\r\n\r\nInclui um prefácio de Manuel Portela e a carta enviada pelo autor a George Orwell, aquando da publicação de \"1984\".\r\n', 15.99, 'Aldous Huxley', 'Romance', 3);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 5, 'O Diário de Anne Frank', '\r\n\r\nEscrito entre 12 de junho de 1942 e 1 de agosto de 1944, O Diário de Anne Frank foi publicado pela primeira vez em 1947, por iniciativa de seu pai, revelando ao mundo o dia a dia de dois longos anos de uma adolescente forçada a esconder-se, juntamente com a sua família e um grupo de outros judeus, durante a ocupação nazi da cidade de Amesterdão.\r\n\r\nTodos os que se encontravam naquele pequeno anexo secreto acabaram por ser presos em agosto de 1944, e em março de 1945 Anne Frank morreu no campo de concentração de Bergen-Belsen, a escassos dois meses do final da guerra na Europa. O seu diário tornar-se-ia um dos livros de não ficção mais lidos em todo o mundo, testemunho incomparável do terror da guerra e do fulgor do Espírito humano.\r\n', 18.50, 'Anne Frank', 'Biografia', 4);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 6, 'A Culpa é das Estrelas', 'Apesar do milagre da medicina que fez diminuir o tumor que a atacara há alguns anos, Hazel nunca tinha conhecido outra situação que não a de doente terminal, sendo o capítulo final da sua vida parte integrante do seu diagnóstico. Mas com a chegada repentina ao Grupo de Apoio dos Miúdos com Cancro de uma atraente reviravolta de seu nome Augustus Waters, a história de Hazel vê-se agora prestes a ser completamente rescrita. PERSPICAZ, ARROJADO, IRREVERENTE E CRU, A Culpa é das Estrelas é a obra mais ambiciosa e comovente que o premiado autor John Green nos apresentou até hoje, explorando de maneira brilhante a aventura divertida, empolgante e trágica que é estar-se vivo e apaixonado.', 8.00, 'John Green', 'Romance', 7);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 7, 'Aqui Dentro Faz Muito Barulho ', 'Escrever é o acto de pensamento mais justo. Obriga à escolha cuidadosa das palavras, a recuperar o pensamento que estava fixado e a fazê-lo voltar a mexer-se. Muitas vezes faz com que terminemos com o resultado contrário ao que tínhamos como certo antes de escrever a primeira palavra. Escrever crónicas obriga a um pensamento constante sobre o que nos rodeia, mas o que nos rodeia nem sempre é companhia aconselhável, e pensar sobre isso pode aumentar – para o bem e para o mal – o que antes não se via. Quando me convidaram para escrever crónicas semanais na revista Sábado (que sai à quinta, já agora), foi essa a minha dúvida: quais seriam as consequências de escolher mais uma maneira de ver de perto as coisas que me aleijam? Para me contrariar, aceitei. Enquanto escrevia dei por mim muitas vezes a pôr em causa o que pensava antes e a pensar sobre o que isso quereria dizer. Não cheguei a conclusão nenhuma, mas ao preparar este livro percebi que as coisas dentro da minha cabeça fazem muito barulho. Ordená-las e escrevê-las é ainda o último reduto de sanidade contra esse ruído. Este livro é uma compilação dessas crónicas que escrevi e que agora vieram para aqui viver todas juntas.', 8.90, 'Bruno Nogueira', 'Humor', 3);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 8, 'Eu Já Devia Saber ', 'Manu está no segundo ano da faculdade e mal pode esperar por ir viver para Lisboa. Além da melhor amiga, Camila, e do irmão por afinidade, Fred, a única pessoa capaz de a tirar do tédio em que vive é o Edu. Mas não está fácil: se há palavra para descrevê-lo é «misterioso»... Alguém conhece um tutorial no YouTube para lidar com isto?\r\nO Edu parece perfeito: é inteligente, bonito e carinhoso. Mas e se não for a pessoa certa para a Manu? E se houver outra pessoa capaz de lhe roubar o coração, alguém que esteve sempre por perto e que ela nunca foi capaz de ver de outra forma? E se… e se ela se apaixonar pela única pessoa do mundo que não pode amar?\r\nNum romance de estreia emocionante, envolvente e cheio de reviravoltas, Bárbara Corby traz-nos uma história de amor que surge onde ninguém esperava. Só que à medida que este amor se torna mais forte, verdadeiro e intenso, mais claro é para todos que simplesmente não pode acontecer.', 5.00, 'Bárbara Corby', 'Romance', 10);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 9, 'O Coala Que Foi Capaz ', 'O Kevin é um coala que gosta de manter tudo na mesma, exatamente na mesma. Mas quando um dia a mudança surge sem ser convidada, o Kevin descobre que a vida pode estar cheia de novidades e ser maravilhosa! Dos criadores de O Leão Que Temos Cá Dentro, esta é uma história bem engraçada para quem acha que a mudança é um bocadinho preocupante. ', 4.00, 'Rachel Bright & Jim Field', 'Infantil', 12);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 10, 'Eu sou Malala', ' Quando O Talibã Tomou Controle Do Vale Do Swat, Uma Menina Levantou A Voz. Malala Yousafzai Recusou-Se A Permanecer Em Silêncio E Lutou Pelo Seu Direito À Educação. Mas Em 9 De Outubro De 2012, Uma Terça-Feira, Ela Quase Pagou O Preço Com A Vida.\r\n\r\nMalala Foi Atingida Na Cabeça Por Um Tiro À Queima-Roupa Dentro Do Ônibus No Qual Voltava Da Escola. Poucos Acreditaram Que Ela Sobreviveria.\r\n\r\nMas A Recuperação Milagrosa De Malala A Levou Em Uma Viagem Extraordinária De Um Vale Remoto No Norte Do Paquistão Para As Salas Das Nações Unidas Em Nova York. Aos Dezesseis Anos, Ela Se Tornou Um Símbolo Global De Protesto Pacífico E A Candidata Mais Jovem Da História A Receber O Prêmio Nobel Da Paz.\r\n\r\nEu Sou Malala É A História De Uma Família Exilada Pelo Terrorismo Global, Da Luta Pelo Direito À Educação Feminina E Dos Obstáculos À Valorização Da Mulher Em Uma Sociedade Que Valoriza Filhos Homens.\r\n\r\nO Livro Acompanha A Infância Da Garota No Paquistão, Os Primeiros Anos De Vida Escolar, As Asperezas Da Vida Numa Região Marcada Pela Desigualdade Social, As Belezas Do Deserto E As Trevas Da Vida Sob O Talibã. ', 29.30, 'Malala Yousafzai & Christina Lamb', 'biografia', 15);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 12, 'Palestina - Uma Biografia: Cem Anos de Guerra e Resistência', '\"Em nome de Deus, que a Palestina seja deixada em paz.\"\r\n\r\nÉ desta forma que o presidente da câmara de Jerusalém termina a carta enviada em 1899 a Theodore Herzl, pai do movimento sionista, onde explicava que a Palestina tinha habitantes nativos e advertia para os perigos que se aproximavam.\r\n\r\nE é com este relato que Rashid Khalidi, o maior historiador do Médio Oriente nos Estados Unidos e sobrinho-neto do autor da dita carta, inicia a sua narrativa sobre os palestinianos e a guerra contra eles travada.\r\n\r\nOriginal, envolvente e marcante, Palestina – Uma Biografia cruza eventos históricos, materiais de arquivo nunca antes explorados e relatos de gerações, tratando de forma simultaneamente sóbria e emotiva os factos de um confronto trágico entre dois povos que reivindicam o mesmo território.\r\n\r\nEsta não é uma crónica de vitimização, uma tentativa de branquear os erros dos líderes palestinianos nem a negação da emergência de movimentos nacionalistas de ambos os lados.\r\n\r\nÉ, antes, uma nova e esclarecedora visão de um conflito com mais de um século, uma história de colonização e de resistência de um povo que não abdica de existir.\" ', 17.99, 'Rashid Khalidi ', 'biografia', 2);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 13, 'Odeio Pessoas', 'Isto não é um livro de autoajuda. Aqui não há frases fofinhas nem o segredo da felicidade, mas, sim, ódio gratuito disfarçado de piadas. São 99 tipos de pessoas que odeio, com muito escárnio e linguagem vernacular, logo é possível que te sintas ofendidinho quando o leres. Se não tiveres fair-play para isso, vai antes procurar alguma coisa na prateleira de esoterismo, ou assim. Já que falamos em tretas, através de uma ferramenta a que chamei \"odiómetro\", neste livro vais poder saber se és uma pessoa com muito ou pouco ódio dentro de ti, bem como o teu signo do zodíaco do ódio – algo que inventei, como fazem os \"verdadeiros\" astrólogos. Voltando ao início: este não é um livro de autoajuda. No entanto, pode ser bem mais benéfico para a tua saúde mental, porque te vai fazer rir das tuas próprias idiossincrasias. (Palavras caras mesmo à boss, logo na sinopse). Afinal, não só todos temos ódios de estimação, mas também somos, nós mesmos, pessoas que muitas vezes odiamos. Ya, ganda plot twist, não foi? ', 16.70, 'Guilherme Duarte', 'humor', 5);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 14, 'A Fada Oriana', 'Dizia Sophia que as fadas são seres da natureza. Queria com isto lembrar que elas nascem da nossa capacidade de atribuir vida, vontade e intenções ao mundo da natureza.\r\n\r\nEm A Fada Oriana, encontramos o dom da proteção sobre os seres mais frágeis que vivem numa floresta, encontramos as tão humanas oscilações entre a solidariedade, o sentido da responsabilidade e o egoísmo e a vaidade. Encontramos, como é próprio de muitos contos tradicionais e para a infância, as peripécias de uma luta entre o bem e o mal.', 12.95, 'Sophia de Mello Breyner Andresen', 'infantil', 6);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 15, 'Vamos Todos Morrer Outra Vez', '100 biografias breves de gente que já lá está De Cléopatra a Isabel II: Uma peregrinação enlutada pela história. «Passo a vida a pensar na marca que quero deixar neste mundo, mas o Vamos Todos Morrer tornou essa demanda menos ansiogénica: todos os dias aprendo que, por mais que me esforce, serei apenas recordada pela badalhoca que fui. Pronto.', 17.90, 'Hugo van der Ding', 'Humor', 0);
INSERT INTO `products` (`image`, `product_id`, `product_name`, `product_desc`, `price`, `author`, `category`, `stock`) VALUES
(, 17, 'O Novo Eu', 'Millie tem trinta anos e não consegue dar um rumo à sua vida, passando os dias a saltar de trabalho temporário em trabalho temporário. As noites, passa-as sozinha no seu apartamento, obcecada sobre como é que poderia dar a volta à situação – ao seu trabalho, à sua atitude, à sua aparência, à sua vida. Depois, vê televisão até adormecer e o ciclo recomeça no dia seguinte. Quando surge a oportunidade de ter uma oferta de emprego estável e a tempo inteiro, Millie começa a ver a luz ao fundo do túnel e a acreditar que a vida melhor com que sonha pode estar agora ao seu alcance: comprar roupas de marca, ter comida saudável em casa e atingir a independência financeira. Mas, vinda das angustiantes profundezas da sua mente, chega-lhe a paralisante constatação de que esta oferta de felicidade pode, afinal, estar esvaziada de sentido. Será que Millie irá encontrar o seu Novo Eu? Uma comédia negra como breu, este o novo romance de leitura obrigatória da autora Halle Butler: de choque entre as expectativas da protagonista e uma realidade sem encanto. ', 16.55, 'Halle Butler', 'Romance', 5);

